    <tr>
      <td>
        <input type="text" value={inputData.name} />
      </td>
      <td>
        <select value={inputData.gender}>
          <option value="男">男</option>
          <option value="女">女</option>
        </select>
      </td>
      <td>
        <input type="text" />
      </td>
      <td>
        <input type="text"  />
      </td>
      <td>
        <button>添加</button>
      </td>
    </tr>
  );
};

